window.bookSummaryJSON = "<p><b>A thrilling adventure based on the hit television series </b><b><i>Star Trek: Picard</i></b><b>. </b><br> <br> <i>Star Trek: No Man’s Land</i> picks up right after the action-packed season one conclusion of <i>Star Trek: Picard. </i>While Raffi and Seven of Nine are enjoying some much-needed R&amp;R in Raffi’s remote hideaway, their downtime is interrupted by an urgent cry for help: a distant, beleaguered planet has enlisted the Fenris Rangers to save an embattled evacuation effort. As Raffi and Seven team up to rescue a mysteriously ageless professor whose infinity-shaped talisman has placed him in the deadly sights of a vicious Romulan warlord, they take tentative steps to explore the attraction depicted in the final moments of <i>Picard </i>season one. Based on the hit audio original, fans can now read this riveting script with fan-favorite characters.</p>"; 
